// CELL Struct



typedef struct CELL
{
    char type;
    char memory;
    struct CELL* left;
    struct CELL* right;
}CELL;

typedef struct pilha
{
	int cabeca_pilha;
	int tamanho;
	CELL** celulas; 
}Pilha;

